import { Table, Row, Col, Container, Button } from "react-bootstrap";
import "../Clinic/Clinic.css";
import { useContext } from "react";
import { DataContext } from "../../Data/DataContext";
import $ from "jquery";
function Tr(props) {
  const [
    nav,
    setNav,
    admin,
    setAdmin,
    user,
    setUser,
    clinc,
    setClinic,
    ads,
    setAds,
    userModal,
    setUserModal,
    useredit,
    setUseredit,
    admins,
    setAdmins,
  ] = useContext(DataContext);

  // Thus function to delete  user
  const deleteRow = (id) => {
    $.ajax({
      url: "http://touch.extra-laboratory.com/api/delete_admin.php",
      type: "post",
      data: {
        id: id,
      },
      success: function (data) {
        let u = JSON.parse(data);
        if (u.code == 200) {
          $.ajax({
            url: "http://touch.extra-laboratory.com/api/get_admin.php",
            success: function (data) {
              let d = JSON.parse(data);
              setAdmins(d);
            },
            error: function (error) {
              console.log(error);
            },
          });
        } else alert(u.message);
      },
      error: function (error) {
        console.log(error);
      },
    });
  };

  return (
    <tr>
      <th>#</th>
      <th>{props.name}</th>
      <th>{props.role}</th>
      <th>{props.date}</th>
      <th>
        <Button
          onClick={() => deleteRow(props.delete)}
          variant="outline-primary"
          size="sm"
        >
          Delete
        </Button>
      </th>
    </tr>
  );
}

export default Tr;
